import "./portfolioList.scss";

function PortfolioList({ title, active, setSelected }) {
  return (
    <li
      className={active ? "portfolioList active" : "portfolioList"}
      onClick={() => setSelected()}
    >
      {title}
    </li>
  );
}

export default PortfolioList;
